"use strict";(self.webpackChunkmia_platform_doc=self.webpackChunkmia_platform_doc||[]).push([[53],{1109:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"2.0 (Current)","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"P4SaMD":[{"type":"link","label":"What is P4SaMD?","href":"/docs/p4samd/overview","docId":"p4samd/overview"},{"label":"Installation","type":"category","items":[{"type":"link","label":"System Requirements","href":"/docs/p4samd/system_requirement","docId":"p4samd/system_requirement"},{"type":"link","label":"Configuration","href":"/docs/p4samd/configuration","docId":"p4samd/configuration"}],"collapsed":true,"collapsible":true},{"label":"Handbook","type":"category","items":[{"type":"link","label":"Getting Started","href":"/docs/p4samd/handbook/getting_started","docId":"p4samd/handbook/getting_started"},{"type":"link","label":"Software Verification","href":"/docs/p4samd/handbook/software_verification","docId":"p4samd/handbook/software_verification"},{"type":"link","label":"SBOM","href":"/docs/p4samd/sbom","docId":"p4samd/sbom"},{"type":"link","label":"Software Items","href":"/docs/p4samd/handbook/software_items","docId":"p4samd/handbook/software_items"},{"type":"link","label":"Insight and Suggestions","href":"/docs/p4samd/handbook/insight_and_suggestions","docId":"p4samd/handbook/insight_and_suggestions"},{"type":"link","label":"System Version","href":"/docs/p4samd/handbook/system_version","docId":"p4samd/handbook/system_version"},{"type":"link","label":"Overview Tab","href":"/docs/p4samd/handbook/tab-overview","docId":"p4samd/handbook/tab-overview"}],"collapsed":true,"collapsible":true},{"type":"link","label":"FAQ","href":"/docs/p4samd/faq","docId":"p4samd/faq"}]},"docs":{"p4samd/configuration":{"id":"p4samd/configuration","title":"Configuration","description":"After the installation of Mia-Care P4SaMD, the configuration activities are carried out by Mia-Care qualified personnel to adapt the system to the customer\u2019s specific requirements. This ensures seamless integration and functionality within the customer\u2019s environment.","sidebar":"P4SaMD"},"p4samd/faq":{"id":"p4samd/faq","title":"Frequently Asked Questions (FAQ)","description":"Welcome to the P4SaMD FAQ page, where we address the most common questions about our platform. This section is designed to provide clear and detailed answers to help you better understand P4SaMD, its capabilities, and its role in the SaMD development lifecycle.","sidebar":"P4SaMD"},"p4samd/handbook/getting_started":{"id":"p4samd/handbook/getting_started","title":"Getting Started","description":"Mia-Care P4SaMD is a robust solution integrated with Mia-Platform IDP at the company level. This integration ensures seamless alignment of development and operational workflows for Software as a Medical Device (SaMD) products.","sidebar":"P4SaMD"},"p4samd/handbook/insight_and_suggestions":{"id":"p4samd/handbook/insight_and_suggestions","title":"Insight & Suggestions","description":"P4SaMD ensures compliance with IEC 62304 rules by analyzing Software Items, Requirements, Risks, and Tests. It detects inconsistencies and suggests modifications to enhance compliance and reduce risks, streamlining medical software development. The user is guided by suggestions indicating necessary actions to achieve compliance, including mandatory, recommended, and optional improvements.","sidebar":"P4SaMD"},"p4samd/handbook/software_items":{"id":"p4samd/handbook/software_items","title":"Software Items","description":"The section allows users to view, create, and edit software items. It provides an intuitive interface for managing software items, including detailed views, adding new entries, and updating existing records. Additionally, using the console, software items are also detected automatically, ensuring efficient and seamless handling of software-related data.","sidebar":"P4SaMD"},"p4samd/handbook/software_verification":{"id":"p4samd/handbook/software_verification","title":"Software Verification","description":"Ensuring the reliability and safety of Software as a Medical Device (SaMD) requires a balanced approach between automated and manual testing. Automated testing is crucial for early and efficient assessment of software quality, allowing fast execution of unit, integration, and regression tests and ensuring regulatory compliance, such as adherence to IEC 62304 and FDA guidelines, thanks to consistent and continuous validation during the entire software lifecycle.","sidebar":"P4SaMD"},"p4samd/handbook/system_version":{"id":"p4samd/handbook/system_version","title":"System Version","description":"Overview","sidebar":"P4SaMD"},"p4samd/handbook/tab-overview":{"id":"p4samd/handbook/tab-overview","title":"Overview Tab","description":"Introduction","sidebar":"P4SaMD"},"p4samd/overview":{"id":"p4samd/overview","title":"What is P4SaMD?","description":"Introduction to P4SaMD","sidebar":"P4SaMD"},"p4samd/sbom":{"id":"p4samd/sbom","title":"Software Bill Of Materials (SBOM)","description":"When developing Software as a Medical Device (SaMD), the Software Bill of Materials (SBOM) is a crucial tool for enhancing transparency, security, and compliance. A SBOM is an inventory of all the software components, libraries, and dependencies that make up a particular software item and includes information like versioning, licensing and known vulnerabilities. Much like a bill of materials in hardware manufacturing, it provides a detailed mapping of what constitutes the software.","sidebar":"P4SaMD"},"p4samd/system_requirement":{"id":"p4samd/system_requirement","title":"System Requirements","description":"Mia-Care P4SaMD is validated to develop SaMD, if you need additional documentation or information please contact us or check the FAQ section.","sidebar":"P4SaMD"}}}')}}]);